import Header from "./components/header";
import Game from "./components/game";
import ButtonWithText from "./components/button_with_text";

const MainPage = ({nav}) => {
    return (
        <div>
            <Header id="header_main" />
            <Button text="Go back" onClick={nav}/>
            <Game />
        </div>
    )
}

export default MainPage;
